import { Component } from 'react';
import { Container } from 'react-bootstrap';
import './style.css';

class Home extends Component {
    constructor(props) {
        super(props);
        this.state = { name: 'Rodrigo' };
      }
    render() {
        return (
            <Container fluid className="homebg p-lg-0">
                <Container> 
                    <h1>Hey there, my name is Rodrigo. I create engaging and pixel perfect websites.</h1> 
                    <h3>Front End Developer / Web Developer / Self-Taught Dev</h3>
                </Container>
            </Container>
        )
    }
}
export default Home;
